      b 28.02.1950
      Jillian b, at Hastings and m, at Pukehou. Paul, s/o Jack and Doris Doherty, b, at Manly, NSW,
      Australia. Address: 18 Willowtree Close, Narara, Gosford 2250, NSW, Australia.
      Jillian was educated at Pukehou School and Woodford House where she was a school prefect. She
      became a NZ Registered Nurse at Auckland Hospital and was industrial nursing in London then was
      Sister in charge of social welfare at Ballarat Base Hospital, Australia. She worked as a sister at
      local Gosford hospitals on an on-call basis. She now has a wholesale plant nursery and works as a
      garden designer.
      Paul was educated at North Narrabeen Boys' High School where he was Senior Prefect. He is a civil
      engineer and is Operations Manager of the Waste Services Department with the Gosford City Council.
      He enjoys the beach, surf lifesaving and water sports as well as music and the outdoors.
